import React from 'react';
import { Text, StyleSheet, Button, View, FlatList, SafeAreaView, TouchableOpacity, Image } from 'react-native';

const Display = () => {

    const page = "https://i.ibb.co/J7mMmbR/one-piece-1003-1.jpg"

    return (

        <View style={styles.container}>
            <Image
                style={styles.pagez}
                source={{uri:page}}
            />
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        backgroundColor: 'grey',
        height: '100%',
        width: '100%',
        alignContent: 'center',
    },
    pagez:{
        height: '50%',
        width: '50%',
        justifyContent: 'center',
        // alignContent: 'center'
    }
});

export default Display;
